    unsigned char deA[128];
    unsigned char deB[128];

    unsigned char RA[64];
    unsigned char RB[64];

    unsigned int k_len = 16;

    unsigned char KA[64];
    unsigned char S1[32];
    unsigned char SA[32];

    unsigned char KB[64];
    unsigned char SB[32];
    unsigned char S2[32];

