/**
 * @brief           SM9   key exchange speed test
 * @return          0 for success, 1 for failure
 */
unsigned int sm9_exchange_key_speed_test(void)
{
    unsigned char ks[32];
    unsigned char rA[32];
    unsigned char rB[32];

    unsigned char ida[5] = {0x41, 0x6C, 0x69, 0x63, 0x65};
    unsigned char idb[3] = {0x42, 0x6F, 0x62};

    unsigned char hid = 0x02;

    unsigned char Ppub_e[64];
    unsigned char deA[128];
    unsigned char deB[128];

    unsigned char RA[64];
    unsigned char RB[64];

    unsigned int k_len = 16;

    unsigned char KA[64];
    unsigned char S1[32];
    unsigned char SA[32];

    unsigned char KB[64];
    unsigned char SB[32];
    unsigned char S2[32];

#ifdef SM9_TEST_WITH_PRE_CALC
    unsigned char g[32 * 12 * 7];
#endif

    unsigned int tmp_key_round = 10;
    unsigned int exchange_round = 2;
    unsigned int round;

    unsigned int i, ret;

    printf("\r\n\r\n -------------- SM9 key exchange speed test -------------- "
           "\r\n");

    uint32_sleep(0x1FFFF, 1);

    ret = sm9_exckey_gen_mastKeyPair(ks, Ppub_e);
    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_exckey_gen_mastKeyPair failure, ret=%x", ret);
        return 1;
    }

    ret = sm9_exckey_gen_userPriKey(ida, 5, hid, ks, deA);
    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_Exckey_KeyGen failure, ret=%x", ret);
        return 1;
    }

    ret |= sm9_exckey_gen_userPriKey(idb, 3, hid, ks, deB);
    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_Exckey_KeyGen failure, ret=%x", ret);
        return 1;
    }

    ret = sm9_exckey_gen_tmpKeyPair(idb, 3, hid, Ppub_e, rA, RA);
    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_Exckey_TmpKeyGen RA failure, ret=%x", ret);
        return 1;
    }

    // test sm9_exckey_gen_tmpKeyPair
    round = tmp_key_round;
    ret = 0;
    printf("\r\n ======== sm9_exckey_gen_tmpKeyPair begin ======== ");
    fflush(stdout);

#ifdef SM9_SPEED_TEST_BY_TIMER
    // round /= 10;
    startp();
#endif

    for (i = 0; i < round; i++)
    {
        ret |= sm9_exckey_gen_tmpKeyPair(ida, 5, hid, Ppub_e, rB, RB);
    }

#ifdef SM9_SPEED_TEST_BY_TIMER
    endp(1, 0, round);
#else
    printf("\r\n finished");
    fflush(stdout);
#endif

    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_Exckey_TmpKeyGen RB failure, ret=%x", ret);
        return 1;
    }

#ifndef SM9_TEST_WITH_PRE_CALC
    // test sm9_exchangekey
    round = exchange_round;
    ret = 0;
    printf("\r\n ======== sm9_exchangekey begin ======== ");
    fflush(stdout);

#ifdef SM9_SPEED_TEST_BY_TIMER
    // round /= 10;
    startp();
#endif

    for (i = 0; i < round; i++)
    {
        ret |= sm9_exchangekey(SM9_Role_Sponsor, ida, 5, idb, 3, NULL, Ppub_e, deA, rA, RA, RB, k_len, KA, S1, SA);
    }

#ifdef SM9_SPEED_TEST_BY_TIMER
    endp(1, 0, round);
#else
    printf("\r\n finished");
    fflush(stdout);
#endif

    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_exchangekey failure %u, ret=%x", i, ret);
        return 1;
    }

#else

    ret = sm9_test_get_pre_calc_g(Ppub_e, NULL, g);
    if (ret)
    {
        return 1;
    }

    // test sm9_exchangekey
    round = exchange_round;
    ret = 0;
    printf("\r\n ======== sm9_exchangekey(SM9_FP12_EXP_COMB_PARTS = %u) begin "
           "======== ",
           SM9_FP12_EXP_COMB_PARTS);
    fflush(stdout);

#ifdef SM9_SPEED_TEST_BY_TIMER
    // round /= 10;
    startp();
#endif

    for (i = 0; i < round; i++)
    {
        ret |= sm9_exchangekey(SM9_Role_Sponsor, ida, 5, idb, 3, g, NULL, deA, rA, RA, RB, k_len, KA, S1, SA);
    }

#ifdef SM9_SPEED_TEST_BY_TIMER
    endp(1, 0, round);
#else
    printf("\r\n finished");
    fflush(stdout);
#endif

    if (SM9_SUCCESS != ret)
    {
        printf("\r\n sm9_exchangekey failure %u, ret=%x", i, ret);
        return 1;
    }
#endif

    ret = sm9_exchangekey(SM9_Role_Responsor, idb, 3, ida, 5, NULL, Ppub_e, deB, rB, RB, RA, k_len, KB, S2, SB);
    if ((SM9_SUCCESS != ret) || memcmp_(KA, KB, 16) || memcmp_(S1, SB, 32) || memcmp_(SA, S2, 32))
    {
        printf("\r\n sm9_exchangekey failure k_len=%u, ret=%x", k_len, ret);
        return 1;
    }
    else
    {
        printf("\r\n sm9_exchangekey success k_len=%u", k_len);
        fflush(stdout);
    }

    return 0;
}

